window.bookSummaryJSON = "<p><b>Urban legends and horrifying fairy tales are springing to life in a sleepy Pennsylvania town, and they are haaangry.</b>&nbsp;</p> <p>Jane Davis has modest new-adult goals: pay the bills, keep her job, and - oh yeah - control her raging saint-like superpowers before they kill her. But searching for the secrets of magic puts Jane on a collision course with villains and monsters so sinister they previously only existed in fiction. To save reality and live to see the year 2000, Jane will have to escape a morally gray ancient cult-poration, team up with a gun nun from a neighboring comba-convent, and captain a band of eccentric heroes to stop a middle-aged madwoman from ripping a hole in the multiverse.&nbsp;&nbsp;</p> <p>Spicy <i>Buffy the Vampire Slayer</i> meets the <i>X Files</i> in this urban fantasy romance adventure full of Arthurian mythology, complex multi-book puzzles, smart humor, and slow-burn m/f and m/m love stories.&nbsp;</p>"; 
